using System;
using System.Collections.Generic;
using Microsoft.VisualStudio.TestTools.UnitTesting;

internal struct Vector2 {
    public double X;
    public double Y;
    public Vector2(double x, double y) {
        this.X = x;
        this.Y = y;
    }
}

[TestClass()]
public class Tests {

    [TestMethod()]
    public void TriangulatesArray() {
        var concatenated = new List<double>(points.Count * 2);
        points.ForEach(p => {
            concatenated.Add(p.X);
            concatenated.Add(p.Y);
        });
        var d1 = new Delaunator(concatenated);
        var d2 = Delaunator.From(points, p => p.X, p => p.Y);
        CollectionAssert.AreEqual(d1.triangles, d2.triangles);
    }

    [TestMethod()]
    public void ProducesCorrectTriangulation() {
        Validate(points);
    }

